from scipy.fftpack import fft, ifft
import matplotlib.pyplot as plt
import numpy as np

def plot_fft(data, dt, title=None):
    """
    Plot signals in the Fourier space to inspect their frequency content.
    Takes as input a dictionary of different signals to plot. These signals are
    all plotted on the same figure.

        data : dict : keys are titles, values are arrays of data to analyze.
        title: str  : title of the graph (optional)
    """
    plt.figure(title)
    if title is not None:
        plt.title(title)

    for key, signal in data.items():
        signal_array = np.array(signal)
        signal_tf = fft(signal_array)
        T = 1.0/800 # sample spacing
        xf = np.linspace(0.0, 1.0/(2.0*T), len(signal_array)//2)

        plt.plot(xf,
                (2.0/len(signal_array)*np.abs(signal_tf[0:len(signal_array)//2])),
                label=key)
    plt.legend()
    plt.grid()
    plt.xlabel('Frequency (hz)')
    plt.ylabel('| Amplitude |')
    plt.show()

def plot_fft_clean(data, dt, title=None):
    """
    Same as plot_fft() but it cleans the data to only have one of each entry
    and then associates a "timestamp" with that data at 500ms between each
    new entry. This should be representative of the actual sensor update
    rate.
    """
    plt.figure(title)
    if title is not None:
        plt.title(title)

    for key, signal in data.items():

        signal_clean = [signal[0]]
        for i in range(1, len(signal)):
            if signal[i] != signal[i-1]:
                signal_clean.append(signal[i])

        signal_array = np.array(signal_clean)
        signal_tf = fft(signal_array)
        T = dt
        xf = np.linspace(0.0, 1.0/(2.0*T), len(signal_array)//2)

        plt.plot(xf,
                (2.0/len(signal_array)*np.abs(signal_tf[0:len(signal_array)//2])),
                label=key)
    plt.legend()
    plt.grid()
    plt.xlabel('Frequency (hz)')
    plt.ylabel('| Amplitude |')
    plt.show()

